                    if (node.Title.Equals(targetTitle, StringComparison.OrdinalIgnoreCase))
                    {
                        result.Add(node);
                    }
                    return;
                }

                // Recursive case: Traverse each child
                foreach (var child in node.Children)
                {
                    FindLastChildren(child);
                }
            }

            // Start the recursion from the current node
            FindLastChildren(this);

            return result;
        }

        public static List<Services.QueryEditor.QueriesTree> FilterTreeByQueryName(IEnumerable<Services.QueryEditor.QueriesTree> nodes, string targetTitle)
        {
            // Recursive function to filter nodes
            List<Services.QueryEditor.QueriesTree> FilterNodes(IEnumerable<Services.QueryEditor.QueriesTree> nodes)
            {
                var result = new List<Services.QueryEditor.QueriesTree>();

                foreach (var node in nodes)
                {
                    // Recursively filter children
                    var filteredChildren = FilterNodes(node.Children);

                    // Check if this node or its children should be included
                    if (node.Title.Equals(targetTitle, StringComparison.OrdinalIgnoreCase) || filteredChildren.Any())
                    {
                        result.Add(new Services.QueryEditor.QueriesTree
                        {
                            Title = node.Title,
                            Key = node.Key,
                            IsLeaf = node.IsLeaf,
                            AdditionalProperties = node.AdditionalProperties,
                            Children = filteredChildren
                        });
                    }
                }

                return result;
            }

            return FilterNodes(nodes);
        }
    }

